import React from 'react';
import './AboutPage.css'
import { Grid } from '@mui/material';


function AboutPage() {
    return (
        <div>
            <div>Header</div>
            <Grid container>
                <Grid item xs={8}>
                    WORDS
                </Grid>
                <Grid item xs={4}>
                    WORDS
                </Grid>

            </Grid>
        </div>
    )
}

export default AboutPage;
